class MoreInfoPage extends Component {

    render() {
         //const { data } = this.props.location.state.myArrayVariableName
        // console.log(data)
        //console.log(item())
        return (
            <div>
                <header />

                <GetInfo product = {item()} />
            </div>
        // <h1>s</h1>

        );
    }
}



function item(){
    var id = localStorage.getItem("id")
   // console.log(id)



    for(var i = 0; i< 4;i++){
        // console.log(productData[i].id)
        if (productData[i].id == id){
           // console.log("here")
            return productData[i]
        }
    }
}

export default MoreInfoPage;
